import React from 'react';
import './Header.css';

const Header = () => {
    return (
        <header className="header">
            <div className="header-overlay">
                <h1 className="header-title">LMS</h1>
                <p className="header-subtitle">Lawyer Management System</p>
            </div>
        </header>
    );
};

export default Header;
